import "./Login.css";
import Card from "../UI/Card";
import React, { useState } from "react";

function Login() {
  const [formValid, setFormValid] = useState(false);
  return (
    <Card>
      <form>
        <div className="email">
          <label>E-mail</label>
          <input></input>
        </div>
        <div className="password">
          <label>Password</label>
          <input></input>
        </div>
        <div className="btn">
          <button disabled={formValid}>Login</button>
        </div>
      </form>
    </Card>
  );
}
export default Login;
